                    }else{
                    var url = JSON.parse(html2).url + '#isVideo=true#'; //log(url)
                    }
                    var html = fetch('https://sc1080.top/api.php/getappapi.index/danmuList', {
                        body: `url_position=0&vod_id=${vod_id}`,
