                        //var dm = $.require('hiker://page/dmFun?rule=dm盒子').dmRoute(dmurl.split('url=')[1]); //log(dm)
                        return JSON.stringify({
                            urls: [url],
                            danmu: 'hiker://files/cache/danmu.xml'
                        })
                    }
                    return url
                    }catch(e){
                        log(e.message)
                        showLoading('失败了')
                        hideLoading()
                        return url
                    }
                }
            }, vod_id, parse),
            col_type: list.length > 3 ? 'text_4' : 'text_2'
        });
    }
}

setTabs(tabs, MY_URL);
setLists(vod_id,parses,lists, getMyVar(MY_URL, '0'));

setResult(d)

